import React from 'react';
import ReactDOM from 'react-dom';
import {AppBar, Tabs, Tab} from 'me'

const Navbar = () => {
    return (
        <AppBar title="My App">
          <Tabs>
            <Tab label="Item 1" />
            <Tab label="Item 2" />
            <Tab label="Item 3" />
            <Tab label="Item 4" />
          </Tabs>
        </AppBar>
      )
    
};

export default Navbar;
